    <ellipse cx={3.85714} cy={3.85714} rx={3.21429} ry={3.21429} fill='black' stroke='black' strokeWidth={7} />
  </svg>
);

const Memo = memo(Ellipse5Icon);
export { Memo as Ellipse5Icon };
